    <meta charset="UTF-8">
    <title>Google Play Store Analytics</title>
    <style>
        body {
            background-color: #E6E6FA;
            font-family: 'Times New Roman', Times, serif;
            margin: 0;
            padding: 20px;
            color: black;
        }

        .dashboard-header {
            position: relative;
            text-align: center;
            padding: 40px 0;
            background: rgba(255, 255, 255, 0.95);
            border-radius: 20px;
            margin-bottom: 40px;
            box-shadow: 0 10px 30px rgba(0,0,0,0.1);
            border: 3px solid #000;
        }

        .google-icon {
            position: absolute;
            left: 30px;
            top: 50%;
            transform: translateY(-50%);
            width: 60px;
        }

        .playstore-icon {
            position: absolute;
            right: 30px;
            top: 50%;
            transform: translateY(-50%);
            width: 50px;
        }

        .main-title {
            font-size: 2.8rem;
            margin: 0;
            color: black;
            font-family: 'Times New Roman', Times, serif;
            font-weight: bold;
        }

        .section-container { max-width: 1400px; margin: 0 auto 70px auto; }
        .section-header {
            font-size: 2rem;
            margin-bottom: 25px;
            color: black;
            border-left: 8px solid black;
            padding-left: 15px;
            font-weight: bold;
        }

        .flex-row {
            display: flex;
            flex-wrap: wrap;
            gap: 40px;
            justify-content: center;
        }

        .chart-card {
            width: 600px;
            height: 600px;
            border: 10px solid #000000;
            border-radius: 80px;
            display: flex;
            align-items: center;
            justify-content: center;
            overflow: hidden;
            box-sizing: border-box;
            box-shadow: 0 15px 35px rgba(0,0,0,0.3);
        }

        .square-inner-black {
            background-color: black;
            width: 520px;
            height: 520px;
            display: flex;
            align-items: center;
            justify-content: center;
            border-radius: 30px;
            padding: 10px;
            box-sizing: border-box;
        }

        .chart-img {
            max-width: 100%;
            max-height: 100%;
            object-fit: contain;
        }

        .grad-purple-pink { background: linear-gradient(135deg, #BB73E0, #FF8DDB); }
        .grad-darkblue-purple { background: linear-gradient(135deg, #1A237E, #BB73E0); }
        .grad-multi-task2 { background: linear-gradient(45deg, #2196F3, #E91E63, #F6EA41, #BB73E0); }
        .grad-yellow-pink { background: linear-gradient(135deg, #F6EA41, #F048C6); }
        .grad-purple-blue { background: linear-gradient(135deg, #BB73E0, #2196F3); }
        .grad-aurora { background: linear-gradient(135deg, #0F2027, #711c91, #ea00d9); }
    </style>
